import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import hero1 from "../images/hero1.jpg";

const Partnership = () => {
  const navigate = useNavigate();
  const [activeTab, setActiveTab] = useState("all");
  const [searchParams, setSearchParams] = useState({
    location: "",
    orgType: "",
    lookingFor: "",
  });

  const handleTabChange = (tab) => {
    setActiveTab(tab);
  };

  const handleSearch = (e) => {
    e.preventDefault();
    // 处理搜索逻辑
    console.log("Search params:", searchParams);
  };

  return (
    <div className="min-h-screen">
      {/* 背景图片容器 */}
      <div className="relative min-h-screen">
        <div className="absolute inset-0">
          <img
            src={hero1}
            alt="Background"
            className="w-full h-full object-cover"
          />
          <div className="absolute inset-0 bg-teal-600/20 backdrop-blur-sm"></div>
        </div>

        {/* 内容区域 */}
        <div className="relative z-10">
          {/* 返回按钮 */}
          <button
            onClick={() => navigate(-1)}
            className="absolute top-8 left-8 text-white hover:text-teal-100 transition-colors"
          >
            <svg
              className="w-8 h-8"
              fill="none"
              stroke="currentColor"
              viewBox="0 0 24 24"
            >
              <path
                strokeLinecap="round"
                strokeLinejoin="round"
                strokeWidth="2"
                d="M10 19l-7-7m0 0l7-7m-7 7h18"
              />
            </svg>
          </button>

          {/* 主要内容 */}
          <div className="container mx-auto px-4 pt-32 pb-20">
            <h1 className="text-5xl font-bold text-white text-center mb-12">
              Let's Find Your Perfect Partner
            </h1>

            {/* 标签栏 */}
            <div className="flex justify-center mb-8 space-x-4">
              {["All", "Nonprofits", "Businesses", "Organizations"].map(
                (tab) => (
                  <button
                    key={tab}
                    onClick={() => handleTabChange(tab.toLowerCase())}
                    className={`px-6 py-2 rounded-full transition-all ${
                      activeTab === tab.toLowerCase()
                        ? "bg-white text-teal-600"
                        : "bg-white/20 text-white hover:bg-white/30"
                    }`}
                  >
                    {tab}
                  </button>
                )
              )}
            </div>

            {/* 搜索表单 */}
            <form
              onSubmit={handleSearch}
              className="max-w-5xl mx-auto bg-white rounded-lg shadow-xl p-6"
            >
              <div className="grid md:grid-cols-12 gap-4">
                {/* Location */}
                <div className="md:col-span-3">
                  <label className="block text-sm font-medium text-gray-700 mb-2">
                    Location
                  </label>
                  <input
                    type="text"
                    className="w-full px-4 py-2 border border-gray-300 rounded-md focus:ring-2 focus:ring-teal-500 focus:border-transparent"
                    placeholder="Enter location"
                    value={searchParams.location}
                    onChange={(e) =>
                      setSearchParams({
                        ...searchParams,
                        location: e.target.value,
                      })
                    }
                  />
                </div>

                {/* Organization Type */}
                <div className="md:col-span-3">
                  <label className="block text-sm font-medium text-gray-700 mb-2">
                    Organization Type
                  </label>
                  <select
                    className="w-full px-4 py-2 border border-gray-300 rounded-md focus:ring-2 focus:ring-teal-500 focus:border-transparent"
                    value={searchParams.orgType}
                    onChange={(e) =>
                      setSearchParams({
                        ...searchParams,
                        orgType: e.target.value,
                      })
                    }
                  >
                    <option value="">Select type</option>
                    <option value="nonprofit">Nonprofit</option>
                    <option value="business">Business</option>
                    <option value="government">Government</option>
                  </select>
                </div>

                {/* Looking For */}
                <div className="md:col-span-4">
                  <label className="block text-sm font-medium text-gray-700 mb-2">
                    What Kind of Organization Are You Looking For
                  </label>
                  <textarea
                    className="w-full px-4 py-2 border border-gray-300 rounded-md focus:ring-2 focus:ring-teal-500 focus:border-transparent"
                    rows="1"
                    placeholder="Describe your ideal partner..."
                    value={searchParams.lookingFor}
                    onChange={(e) =>
                      setSearchParams({
                        ...searchParams,
                        lookingFor: e.target.value,
                      })
                    }
                  />
                </div>

                {/* Search Button */}
                <div className="md:col-span-2 flex items-end">
                  <button
                    type="submit"
                    className="w-full px-6 py-2 bg-teal-600 text-white rounded-md hover:bg-teal-700 transition-colors focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-teal-500"
                  >
                    Search
                  </button>
                </div>
              </div>
            </form>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Partnership;
